import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      isLogged: false,
    };
  }

  render() {
    let disp = this.state.isLogged ? 'Logged in' : 'Logged out';

    return (
      <div>
        {disp}
        <button>Log In</button>
      </div>
    );
  }
}

export default App;
